import React from "react";
import { Box, Grid, Typography, Button } from "@material-ui/core";
import { ZoomOutTwoTone } from "@material-ui/icons";

const skills = [ "Javascript", "React.js", "Node.js"];

export default props => {

    return(
        <Box>
            <Grid container>
            <Grid item x6>
            <Typography variant="subtitle1">Quality Assurance Analyst</Typography>
            <Typography variant="subtitle2">Teknorix</Typography>
            </Grid>
            
            <Grid item container x6>
                {skills.map((skill) => (<Grid key={skill} item>{skill}</Grid>))}
            </Grid>
            <Grid item container x6>
                <Grid item>
                <Typography>
                    <Button pr={2} variant="outlined">Apply</Button>
                    <Button variant="outlined">View</Button>
                </Typography>
                </Grid>
            </Grid>
                

                

            </Grid>
        </Box>
    )
}
